let instance;

class ColorPallete {
  constructor() {
    if (instance) {
      throw new Error("New instance cannot be created!!");
    }

    instance = this;
  }

  static primary = "#6096B4";
  static secondary = "#93BFCF";
  static third = "#BDCDD6";
  static fourth = "#EEE9DA";
}

let colorPallete = Object.freeze(new ColorPallete());

export default colorPallete;
